                'zoneType'    => $zoneType10,
                'name'        => 'Val de Dearg',
                'description' => 'Cette vallée des Mòr Roimh doit son nom, qui signifie « rouge », à la teinte des minerais de cuivre dont les montagnes avoisinantes sont riches, et qui a aussi donné leur nom à la rivière rouge qui irrigue le val et au Lac Rouge. Deux communautés y sont implantées : Dearg, un village minier, et Fearìl, spécialisé dans le bûcheronnage. Comme il ne reste aucun héritier de la famille Mac Govrian qui gouvernait le val, la régence est assurée par les chevaliers hilderins de la forteresse de Smiorail.',
