                'description' => 'Bien que la terre de ce val, dans le duché de Kel Loar, soit réputée comme ingrate, les habitants du village qui l\'occupe parviennent à en tirer des moissons qui subviennent largement à leurs besoins, auxquelles s\'ajoute le produit toujours fructueux de la pêche et de la chasse.',
