                'name'        => 'Val de Loch Varn',
                'description' => 'Le nom de cette vallée perdue dans les montagnes, proche de la frontière gwidrite, vient de son lac, sur les rives duquel s\'est établi un modeste village éponyme. Le val est marqué par le phénomène dit de « terre brune », une formation marécageuse autour d\'une ancienne usine magientiste abandonnée, ce qui a donné lieu à l\'élévation d\'un sanctuaire dédié à Gluta, l\'esprit des marais. Plusieurs cols permettent de sortir de la vallée, vers Melwan, Dearg, ou la partie orientale du royaume.',
