                'name'        => 'Val de Melwan',
                'description' => 'Cette vallée, irriguée par la Nuarranta, la « rivière noire », se situe au nord de Taol-Kaer, proche de la frontière gwidrite. Le village minier de Melwan et le val sont dirigés par la famille Mac Lyr. Vers le val de Loch Varn, l\'angarde du col de Dohag est toujours en activité, tandis que près du col menant au val de Dearg, le bastion de Néart est désormais occupé par un magientiste.

