                'description' => '"L\'archipel des Trois Sœurs" regroupe trois principales îles – Tir na Loch,  Fortriù et  Bolcànir – ainsi que quelques petits îlots. L\'origine de son nom a depuis longtemps été oubliée. S\'il y a eu de nombreuses théories sur ce que l\'on peut y trouver, communautés primitives ou culture florissante, feondas ou demorthèn radicaux, c\'est cette dernière qui se vérifie. L\'archipel est en effet devenu le refuge des plus traditionalistes.',
