                'name'        => 'Royaume de Gwidre',
                'description' => 'Le royaume de Gwidre se situe au nord ouest de la péninsule de Tri-Kazel, séparé de Taol-Kaer par le fleuve Kreizhdour. Le roi actuel, Dalenverch IV, gouverne depuis la capitale Ard-Amrach un peuple d\'environ six cent mille habitants. Il est aidé dans sa tâche par le Hiérophante Anthénor, chef suprême du Temple. Cette religion continentale du Dieu Unique est en effet devenue la foi officielle du royaume, et les demorthèn et les anciennes traditions y sont pourchassés.',
